"use strict";fetch("themes.json").then(function(n){return n.json()}).then(function(n){n.forEach(function(n){var e=document.createElement("div");e.classList.add("card"),e.innerHTML='\n    <header>\n      <h3 class="theme-title"><a href="'.concat(n.link,'">').concat(n.title,'</a></h3>\n      <a class="btn-download" href="').concat(n.link,'"><i class="fas fa-chevron-circle-down"></i></a>\n    </header>\n    <a class="meta" href="').concat(n.link,'">\n      <img src="').concat(n.image,'">\n      <p class="description">').concat(n.description,"</p>\n    </a>\n    "),document.getElementById("main_content").appendChild(e)})});